var uiMeta = {
    name: 'button-item',
    fields: [,
    //field参数列表：字段属性名|属性默认值|属性类型|是否必填|属性描述
    field('clickKey', undefined, PropTypes.string, false, '按钮项被点击的键值标识'), field('children', undefined, PropTypes.string, false, '按钮显示的文本'), field('className', undefined, PropTypes.string, false, '按钮项的自定义样式名')]
};
var YYButtonItem = YYClass.create({
    uiMeta: uiMeta
});

module.exports = YYButtonItem;